    const poema = JSON.parse(localStorage.getItem('poema'));
    return(
     <div class="yo">

       <h2>{poema.title.rendered}</h2>
       <div dangerouslySetInnerHTML={{__html: poema.content.rendered}} />

     </div>
    )
   }

   export default Poema;
